    Omit<PlasmicShopCalender__VariantsArgs, ReservedPropsType> &
    // Specify args directly as props
    Omit<PlasmicShopCalender__ArgsType, ReservedPropsType> &
    // Specify overrides for each element directly as props
    Omit<
      NodeOverridesType<T>,
      ReservedPropsType | VariantPropType | ArgPropType
